import {Link, NavLink, Route,Routes} from 'react-router-dom';
import './index.css';
import App from './App';




function Home()
{

return(
<Routes>
<NavLink to="./App.css"></NavLink>
      <Route path="/" component={App}></Route>
  </Routes>
)
}

export default Home
